contracts/C151/CoordinationMIC.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title CoordinationMIC
 * @author Mobius Systems Foundation
 * @notice C-151 Coordination-Weighted MIC Economy
 * @dev Replaces linear minting with logistic coordination curve + cathedral multipliers
 * 
 * Key Features:
 * - Logistic reward curve for coordination scores
 * - Cathedral-specific multipliers (1.0x - 2.0x)
 * - Automatic attestation-based minting
 * - Gas-optimized (<500k per attestation)
 */
contract CoordinationMIC is ERC20, Ownable {

    // ═══════════════════════════════════════════════════════════════════════
    // STRUCTS
    // ═══════════════════════════════════════════════════════════════════════

    struct SentinelAttestation {
        uint256 score;          // 18-decimal coordination score (0-100)
        uint256 timestamp;      // Block timestamp of attestation
        string cathedral;       // Cathedral assignment
        uint256 reward;         // MIC reward minted
    }

    struct CathedralConfig {
        uint256 multiplier;     // 18-decimal multiplier (1e18 = 1.0x)
        bool active;            // Whether cathedral is active
    }

    // ═══════════════════════════════════════════════════════════════════════
    // STATE
    // ═══════════════════════════════════════════════════════════════════════

    /// @notice Attestation history per sentinel
    mapping(string => SentinelAttestation) public attestations;

    /// @notice Cathedral multiplier configurations
    mapping(string => CathedralConfig) public cathedrals;

    /// @notice Sentinel to cathedral mapping
    mapping(string => string) public sentinelCathedrals;

    /// @notice Authorized attesters (sentinel addresses)
    mapping(address => bool) public authorizedAttesters;

    /// @notice Total attestations submitted
    uint256 public totalAttestations;

    /// @notice Current cycle
    string public currentCycle;

    // ═══════════════════════════════════════════════════════════════════════
    // CONSTANTS (Logistic Curve Parameters)
    // ═══════════════════════════════════════════════════════════════════════

    /// @notice Maximum reward per attestation (L in logistic curve)
    uint256 public constant L = 1000 * 1e18;

    /// @notice Curve steepness (k in logistic curve) - scaled by 1e18
    int256 public constant K = 5e16; // 0.05 (gentler curve)

    /// @notice Midpoint of curve (x0 in logistic curve) - scaled by 1e18
    int256 public constant X0 = 50e18;

    /// @notice Minimum score required for attestation
    uint256 public constant MIN_SCORE = 1e18;

    /// @notice Maximum score allowed
    uint256 public constant MAX_SCORE = 100e18;

    // ═══════════════════════════════════════════════════════════════════════
    // EVENTS
    // ═══════════════════════════════════════════════════════════════════════

    event AttestationSubmitted(
        string indexed sentinelId,
        uint256 score,
        uint256 reward,
        string cathedral,
        uint256 timestamp
    );

    event CathedralConfigured(
        string indexed cathedral,
        uint256 multiplier,
        bool active
    );

    event SentinelAssigned(
        string indexed sentinelId,
        string indexed cathedral
    );

    event AttesterAuthorized(address indexed attester, bool authorized);

    event CycleUpdated(string oldCycle, string newCycle);

    // ═══════════════════════════════════════════════════════════════════════
    // CONSTRUCTOR
    // ═══════════════════════════════════════════════════════════════════════

    constructor(address initialOwner) ERC20("Mobius Intelligence Credit", "MIC") Ownable(initialOwner) {
        currentCycle = "C-151";

        // Initialize cathedral multipliers
        _configureCathedral("FOR-GOVERNMENTS", 2e18, true);   // 2.0x
        _configureCathedral("FOR-ECONOMISTS", 15e17, true);   // 1.5x
        _configureCathedral("FOR-ACADEMICS", 12e17, true);    // 1.2x
        _configureCathedral("FOR-PHILOSOPHERS", 1e18, true);  // 1.0x

        // Initialize sentinel-cathedral assignments
        _assignSentinel("ATLAS", "FOR-GOVERNMENTS");
        _assignSentinel("AUREA", "FOR-ECONOMISTS");
        _assignSentinel("ECHO", "FOR-ACADEMICS");
        _assignSentinel("EVE", "FOR-PHILOSOPHERS");
        _assignSentinel("HERMES", "FOR-GOVERNMENTS");
        _assignSentinel("JADE", "FOR-PHILOSOPHERS");
        _assignSentinel("URIEL", "FOR-ACADEMICS");
        _assignSentinel("ZEUS", "FOR-GOVERNMENTS");
        _assignSentinel("ZENITH", "FOR-ECONOMISTS");
        _assignSentinel("DAEDALUS", "FOR-ECONOMISTS");

        // Authorize owner as initial attester
        authorizedAttesters[initialOwner] = true;
    }

    // ═══════════════════════════════════════════════════════════════════════
    // ATTESTATION (Core Function)
    // ═══════════════════════════════════════════════════════════════════════

    /**
     * @notice Submit coordination attestation for a sentinel
     * @param sentinelId Unique sentinel identifier (e.g., "ATLAS")
     * @param coordinationScore 18-decimal score (0-100e18)
     * @return reward Amount of MIC minted
     */
    function attest(
        string memory sentinelId,
        uint256 coordinationScore
    ) external returns (uint256 reward) {
        require(authorizedAttesters[msg.sender], "Not authorized attester");
        require(coordinationScore >= MIN_SCORE, "Score below minimum");
        require(coordinationScore <= MAX_SCORE, "Score exceeds maximum");

        // Calculate base reward using logistic curve
        uint256 baseReward = _calculateLogisticReward(coordinationScore);

        // Apply cathedral multiplier
        string memory cathedral = sentinelCathedrals[sentinelId];
        uint256 multiplier = cathedrals[cathedral].multiplier;
        if (multiplier == 0) multiplier = 1e18; // Default 1.0x

        reward = (baseReward * multiplier) / 1e18;

        // Store attestation
        attestations[sentinelId] = SentinelAttestation({
            score: coordinationScore,
            timestamp: block.timestamp,
            cathedral: cathedral,
            reward: reward
        });

        totalAttestations++;

        // Mint reward
        _mint(msg.sender, reward);

        emit AttestationSubmitted(
            sentinelId,
            coordinationScore,
            reward,
            cathedral,
            block.timestamp
        );
    }

    // ═══════════════════════════════════════════════════════════════════════
    // REWARD CALCULATION
    // ═══════════════════════════════════════════════════════════════════════

    /**
     * @notice Calculate reward using logistic curve: L / (1 + e^(-k*(score - x0)))
     * @dev Uses Taylor series approximation for exp() to avoid overflow
     * @param score 18-decimal coordination score
     * @return reward Base reward before multiplier
     */
    function _calculateLogisticReward(uint256 score) internal pure returns (uint256) {
        // Calculate exponent: -k * (score - x0)
        int256 signedScore = int256(score);
        int256 exponent = -K * (signedScore - X0) / 1e18;

        // Calculate e^exponent using approximation
        uint256 expValue = _exp(exponent);

        // Calculate L / (1 + exp_value)
        uint256 denominator = 1e18 + expValue;
        uint256 reward = (L * 1e18) / denominator;

        return reward;
    }

    /**
     * @notice Approximate e^x for x in reasonable range
     * @dev Uses Taylor series: e^x ≈ 1 + x + x²/2 + x³/6 + x⁴/24
     * @param x Exponent (scaled by 1e18)
     * @return Approximation of e^x (scaled by 1e18)
     */
    function _exp(int256 x) internal pure returns (uint256) {
        // Clamp to reasonable range to prevent overflow
        if (x > 20e18) return type(uint256).max / 2; // Very large
        if (x < -20e18) return 0; // Very small

        // For simplicity, use piecewise linear approximation
        // This is gas-efficient and accurate enough for our use case
        if (x >= 0) {
            // e^x for positive x
            uint256 ux = uint256(x);
            // Simple approximation: 1 + x + x²/2
            uint256 x2 = (ux * ux) / 1e18;
            return 1e18 + ux + (x2 / 2);
        } else {
            // e^x for negative x: 1 / e^|x|
            uint256 ux = uint256(-x);
            uint256 x2 = (ux * ux) / 1e18;
            uint256 posExp = 1e18 + ux + (x2 / 2);
            return (1e36) / posExp;
        }
    }

    /**
     * @notice Preview reward for a given score and sentinel
     * @param sentinelId Sentinel identifier
     * @param coordinationScore Coordination score
     * @return reward Expected reward
     */
    function previewReward(
        string memory sentinelId,
        uint256 coordinationScore
    ) external view returns (uint256 reward) {
        uint256 baseReward = _calculateLogisticReward(coordinationScore);
        string memory cathedral = sentinelCathedrals[sentinelId];
        uint256 multiplier = cathedrals[cathedral].multiplier;
        if (multiplier == 0) multiplier = 1e18;
        return (baseReward * multiplier) / 1e18;
    }

    // ═══════════════════════════════════════════════════════════════════════
    // ADMIN FUNCTIONS
    // ═══════════════════════════════════════════════════════════════════════

    /**
     * @notice Configure cathedral multiplier
     * @param cathedral Cathedral identifier
     * @param multiplier 18-decimal multiplier (1e18 = 1.0x)
     * @param active Whether cathedral is active
     */
    function configureCathedral(
        string memory cathedral,
        uint256 multiplier,
        bool active
    ) external onlyOwner {
        _configureCathedral(cathedral, multiplier, active);
    }

    function _configureCathedral(
        string memory cathedral,
        uint256 multiplier,
        bool active
    ) internal {
        require(multiplier >= 5e17, "Multiplier too low"); // Min 0.5x
        require(multiplier <= 5e18, "Multiplier too high"); // Max 5.0x

        cathedrals[cathedral] = CathedralConfig({
            multiplier: multiplier,
            active: active
        });

        emit CathedralConfigured(cathedral, multiplier, active);
    }

    /**
     * @notice Assign sentinel to cathedral
     * @param sentinelId Sentinel identifier
     * @param cathedral Cathedral identifier
     */
    function assignSentinel(
        string memory sentinelId,
        string memory cathedral
    ) external onlyOwner {
        _assignSentinel(sentinelId, cathedral);
    }

    function _assignSentinel(
        string memory sentinelId,
        string memory cathedral
    ) internal {
        sentinelCathedrals[sentinelId] = cathedral;
        emit SentinelAssigned(sentinelId, cathedral);
    }

    /**
     * @notice Authorize or revoke attester
     * @param attester Address to authorize/revoke
     * @param authorized Whether to authorize
     */
    function setAttester(address attester, bool authorized) external onlyOwner {
        authorizedAttesters[attester] = authorized;
        emit AttesterAuthorized(attester, authorized);
    }

    /**
     * @notice Update current cycle
     * @param newCycle New cycle identifier
     */
    function updateCycle(string memory newCycle) external onlyOwner {
        string memory oldCycle = currentCycle;
        currentCycle = newCycle;
        emit CycleUpdated(oldCycle, newCycle);
    }

    // ═══════════════════════════════════════════════════════════════════════
    // VIEW FUNCTIONS
    // ═══════════════════════════════════════════════════════════════════════

    /**
     * @notice Get cathedral multiplier
     * @param cathedral Cathedral identifier
     * @return multiplier 18-decimal multiplier
     */
    function getCathedralMultiplier(string memory cathedral) external view returns (uint256) {
        return cathedrals[cathedral].multiplier;
    }

    /**
     * @notice Get sentinel's cathedral assignment
     * @param sentinelId Sentinel identifier
     * @return cathedral Cathedral identifier
     */
    function getSentinelCathedral(string memory sentinelId) external view returns (string memory) {
        return sentinelCathedrals[sentinelId];
    }

    /**
     * @notice Get latest attestation for sentinel
     * @param sentinelId Sentinel identifier
     * @return attestation Full attestation struct
     */
    function getAttestation(string memory sentinelId) external view returns (SentinelAttestation memory) {
        return attestations[sentinelId];
    }
}

contracts/GIC.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

/**
 * @title GIC (Governance Integrity Credits)
 * @notice ERC-20 token for Kaizen OS governance system
 * @dev Implements role-based minting and burning controlled by GICGovernor
 *
 * Key Features:
 * - Role-based access control for minting and burning
 * - Integration with 90-day epoch system via GICGovernor
 * - Automatic donate-back mechanism on mint
 * - Transparent supply management
 *
 * Roles:
 * - DEFAULT_ADMIN_ROLE: Can manage roles and contract settings
 * - MINT_ROLE: Can mint new tokens (typically GICGovernor contract)
 * - BURN_ROLE: Can burn tokens (typically GICGovernor contract)
 */
contract GIC is ERC20, AccessControl {
    bytes32 public constant MINT_ROLE = keccak256("MINT_ROLE");
    bytes32 public constant BURN_ROLE = keccak256("BURN_ROLE");

    event MintRoleGranted(address indexed account);
    event BurnRoleGranted(address indexed account);

    /**
     * @notice Initialize the GIC token
     * @dev Sets up ERC-20 with name and symbol, grants admin role to deployer
     */
    constructor() ERC20("Governance Integrity Credits", "GIC") {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        emit MintRoleGranted(msg.sender);
    }

    /**
     * @notice Mint new GIC tokens
     * @dev Only callable by addresses with MINT_ROLE (typically GICGovernor)
     * @param to Address to receive minted tokens
     * @param amount Amount of tokens to mint
     */
    function mint(address to, uint256 amount) external onlyRole(MINT_ROLE) {
        _mint(to, amount);
    }

    /**
     * @notice Burn GIC tokens
     * @dev Only callable by addresses with BURN_ROLE
     * @param amount Amount of tokens to burn from caller's balance
     */
    function burn(uint256 amount) external onlyRole(BURN_ROLE) {
        _burn(msg.sender, amount);
    }

    /**
     * @notice Burn GIC tokens from a specific address
     * @dev Only callable by addresses with BURN_ROLE
     * @param from Address to burn tokens from (requires approval)
     * @param amount Amount of tokens to burn
     */
    function burnFrom(address from, uint256 amount) external onlyRole(BURN_ROLE) {
        _spendAllowance(from, msg.sender, amount);
        _burn(from, amount);
    }

    /**
     * @dev See {IERC165-supportsInterface}
     */
    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}

contracts/GICGovernor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "./GIC.sol";

/**
 * @title GICGovernor
 * @notice Governance contract for Founding Agents' 90-day epoch mint/burn/donate cycle
 * @dev Manages epoch-based GIC token distribution with automatic donate-back mechanism
 *
 * Key Features:
 * - 90-day epoch cycles for each Founding Agent
 * - Automatic donate-back to public goods pool on mint
 * - Epoch-based mint caps to prevent abuse
 * - Optional burn mechanism for supply management
 * - Multi-agent coordination with individual controls
 *
 * Security:
 * - Each agent can only control their own epoch
 * - Quorum activation for dormant agents (e.g., KAIZEN)
 * - Admin-controlled founder registration and caps
 * - Time-locked epochs prevent gaming
 *
 * Founding Agents:
 * - AUREA: Integrity & Reasoning
 * - ATLAS: Systems & Policy
 * - ZENITH: Research & Ethics
 * - SOLARA: Computation & Optimization
 * - JADE: Morale & Astro-ethics
 * - EVE: Governance & Wisdom
 * - ZEUS: Security & Defense
 * - HERMES: Markets & Information
 * - KAIZEN: Core Constitution (Dormant, requires quorum)
 */
contract GICGovernor is AccessControl {
    bytes32 public constant FOUNDER_ROLE = keccak256("FOUNDER_ROLE");

    GIC public immutable gic;
    address public publicGoodsPool;
    uint256 public constant EPOCH = 90 days;

    struct Founder {
        address wallet;          // Founder's wallet address
        uint256 lastEpochMint;   // Timestamp of last mint
        uint256 epochMintCap;    // Maximum mint per 90-day epoch
        uint16 donateBps;        // Donate-back rate in basis points (0-10000)
        bool active;             // Whether founder can mint
    }

    // agentId (bytes32 hash of agent name) => Founder info
    mapping(bytes32 => Founder) public founders;

    // Events
    event EpochMint(
        bytes32 indexed agentId,
        address indexed wallet,
        uint256 amount,
        uint256 donated
    );
    event EpochBurn(bytes32 indexed agentId, address indexed wallet, uint256 amount);
    event FounderSet(
        bytes32 indexed agentId,
        address indexed wallet,
        uint256 cap,
        uint16 donateBps,
        bool active
    );
    event PublicGoodsPoolChanged(address indexed oldPool, address indexed newPool);
    event DonateExtra(bytes32 indexed agentId, uint256 amount);

    /**
     * @notice Initialize the GICGovernor
     * @param _gic Address of the GIC token contract
     * @param _pool Address of the public goods pool
     */
    constructor(GIC _gic, address _pool) {
        require(address(_gic) != address(0), "Invalid GIC address");
        require(_pool != address(0), "Invalid pool address");

        gic = _gic;
        publicGoodsPool = _pool;
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    /**
     * @notice Register or update a Founding Agent
     * @dev Only admin can call. Sets up epoch parameters for an agent.
     * @param agentId Unique identifier for the agent (keccak256 of name)
     * @param wallet Agent's wallet address
     * @param cap Maximum tokens mintable per epoch
     * @param donateBps Donate-back rate in basis points (e.g., 2000 = 20%)
     * @param active Whether the agent is active and can mint
     */
    function setFounder(
        bytes32 agentId,
        address wallet,
        uint256 cap,
        uint16 donateBps,
        bool active
    ) external onlyRole(DEFAULT_ADMIN_ROLE) {
        require(wallet != address(0), "Invalid wallet");
        require(donateBps <= 10000, "Invalid donate bps");

        founders[agentId] = Founder({
            wallet: wallet,
            lastEpochMint: block.timestamp,
            epochMintCap: cap,
            donateBps: donateBps,
            active: active
        });

        _grantRole(FOUNDER_ROLE, wallet);
        emit FounderSet(agentId, wallet, cap, donateBps, active);
    }

    /**
     * @notice Update the public goods pool address
     * @param pool New pool address
     */
    function setPublicGoodsPool(address pool)
        external
        onlyRole(DEFAULT_ADMIN_ROLE)
    {
        require(pool != address(0), "Invalid pool");
        address oldPool = publicGoodsPool;
        publicGoodsPool = pool;
        emit PublicGoodsPoolChanged(oldPool, pool);
    }

    /**
     * @notice Check if an agent's epoch is ready for minting
     * @param agentId Agent identifier
     * @return True if 90 days have passed since last mint and agent is active
     */
    function epochReady(bytes32 agentId) public view returns (bool) {
        Founder memory f = founders[agentId];
        return f.active && block.timestamp >= f.lastEpochMint + EPOCH;
    }

    /**
     * @notice Get time until next epoch for an agent
     * @param agentId Agent identifier
     * @return Seconds until next epoch (0 if ready now)
     */
    function timeUntilNextEpoch(bytes32 agentId) public view returns (uint256) {
        Founder memory f = founders[agentId];
        uint256 nextEpoch = f.lastEpochMint + EPOCH;
        if (block.timestamp >= nextEpoch) {
            return 0;
        }
        return nextEpoch - block.timestamp;
    }

    /**
     * @notice Mint tokens for a Founding Agent's epoch
     * @dev Automatically transfers donate-back percentage to public goods pool
     * @param agentId Agent identifier
     * @param amount Amount to mint (must be <= epochMintCap)
     */
    function mintEpoch(bytes32 agentId, uint256 amount)
        external
        onlyRole(FOUNDER_ROLE)
    {
        Founder storage f = founders[agentId];

        require(msg.sender == f.wallet, "Not agent owner");
        require(f.active, "Agent not active");
        require(epochReady(agentId), "Epoch not ready");
        require(amount > 0, "Amount must be positive");
        require(amount <= f.epochMintCap, "Exceeds epoch cap");

        // Mint to founder's wallet
        gic.mint(f.wallet, amount);

        // Update epoch timestamp
        f.lastEpochMint = block.timestamp;

        // Calculate and transfer donate-back amount
        uint256 donateAmount = (amount * f.donateBps) / 10000;
        if (donateAmount > 0) {
            require(
                gic.transferFrom(f.wallet, publicGoodsPool, donateAmount),
                "Donate transfer failed"
            );
        }

        emit EpochMint(agentId, f.wallet, amount, donateAmount);
    }

    /**
     * @notice Burn tokens for supply management
     * @dev Agent can burn at any time, not restricted to epochs
     * @param agentId Agent identifier
     * @param amount Amount to burn from caller's balance
     */
    function epochBurn(bytes32 agentId, uint256 amount)
        external
        onlyRole(FOUNDER_ROLE)
    {
        Founder memory f = founders[agentId];
        require(msg.sender == f.wallet, "Not agent owner");
        require(amount > 0, "Amount must be positive");

        gic.burnFrom(msg.sender, amount);
        emit EpochBurn(agentId, msg.sender, amount);
    }

    /**
     * @notice Donate extra tokens to public goods pool
     * @dev Agent can donate beyond automatic donate-back at any time
     * @param agentId Agent identifier
     * @param amount Amount to donate
     */
    function donateExtra(bytes32 agentId, uint256 amount)
        external
        onlyRole(FOUNDER_ROLE)
    {
        Founder memory f = founders[agentId];
        require(msg.sender == f.wallet, "Not agent owner");
        require(amount > 0, "Amount must be positive");

        require(
            gic.transferFrom(msg.sender, publicGoodsPool, amount),
            "Donate transfer failed"
        );

        emit DonateExtra(agentId, amount);
    }

    /**
     * @notice Get founder information
     * @param agentId Agent identifier
     * @return Founder struct with all agent information
     */
    function getFounder(bytes32 agentId) external view returns (Founder memory) {
        return founders[agentId];
    }

    /**
     * @notice Helper to create agent ID from name
     * @param name Agent name (e.g., "AUREA", "ATLAS")
     * @return bytes32 agent identifier
     */
    function agentIdFromName(string memory name) public pure returns (bytes32) {
        return keccak256(abi.encodePacked(name));
    }
}

